import React, { Component } from 'react';




const EditButton = (props) => {
  let editButton = null;
  if (props.isOwnPost) {
    editButton = (
      <button className="user-edit">
        <span className="jam jam-pencil" style={{ color: '#8a8184' }}></span>
      </button>
    );
  }
  return (
   {editButton}
  );
};

export default EditButton;
